import { geoNaturalEarth1 } from 'd3';
import { hexbin as d3Hexbin } from 'd3-hexbin'; // Import hexbin from d3-hexbin

const projection = geoNaturalEarth1()
    .center([10.537004, 52.210297]) // Center over Braunschweig, Germany
    .scale(160000)
    .translate([450, 300]);

export const Marks = ({ bins, sizeValue, projection }) => (
    <g className="marks">
        {bins.map((bin, i) => {
            const size = sizeValue(bin) || 0; // Optional size calculation
            const [x, y] = bin.x; // Get the center of the bin

            return (
                <path
                    key={i}
                    d={d3Hexbin().hexagon(10)} // Use the imported hexbin to create the hexagon shape
                    transform={`translate(${x}, ${y})`} // Position the hexagon
                    fill="orange" // Adjust color as needed
                    stroke="black"
                    strokeWidth={1}
                />
            );
        })}
    </g>
);
